import React from 'react';
import {View, Text, Button} from 'react-native';

class ListScheduleDay extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      schedule:[
      {title:'Lesson1',start:'9:00',end:'11:00',lesson:'The Duc'},
      {title:'Lesson2',start:'13:00',end:'15:00',lesson:'Toan'},
      {title:'Lesson3',start:'15:00',end:'17:00',lesson:'Van'},
    ],
    }}

  render() {
    return(
      <View>
      {this.state.schedule.map(item => {
        <View>
          <Text>{item.title}</Text>
          <Text>{item.start}</Text>
          <Text>{item.end}</Text>
          <Text>{item.lesson}</Text>
        </View>
      })}
      </View>
    )}
}

export default ListScheduleDay;
